E_D("replace into `phome_ecms_game` values('580','5','0','','','','1','admin','','1','0','1343189138','0','0','0','0','','','580','0','0','0','0','0','0','倒霉熊大电影','1343189138','/spic/20120725/148.jpg','0','1','1343189138','0','3','1','0','','0','','','667','479','对于全心全意等待圣诞老人来临的北北来说，圣诞前夜的降临是一件很幸福的事情，因为圣诞老人会给他带来礼物，而他的愿望就是拥有一张魔术毯子！！礼物送来了，北北小心翼翼的打开了它……出现在他眼前的竟然是一个巨大的杯子。具有魔力的杯子带着北北来到了他做梦也想不到的地方——北极！在北极遇见的第一个“人”居然是一只正在钓鱼的熊，更令北北吃惊的是这里还不只白熊一个..... ','1','','0','','1','/dpic/20120725/149.jpg','561','/donghuapian/561/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0175.jpg','http://www.61baobao.com/donghuapian/pic/05/0175.jpg','0','三个月以上','1','youku,77502904|||','0','','0','0','0');");
